 select 17222457 contrato, 2891 unidad, to_Date('21/03/2015','dd/mm/yyyy') fecha_inspeccion, '72258' codigo_certi,'84452848' cedula, 'MICHAEL DE LA HOZ' inspector from dual
 )
 select *
 from tabla
 where rownum<=2
   and not exists(select null from open.ldc_certificados_oia c where c.id_contrato=contrato and c.CERTIFICADO=codigo_certi);
 
 sbMensaje SYS_REFCURSOR;
 nuError NUMBER(4);
 sbError VARCHAR2(2000);
 nuCertificado number;
 nuContrato  number;
begin
  for reg in cuDatos loop
    sbMensaje:=null;
    begin
       ldci_pkrevisionperiodicaweb.proregisternewcertirp(inucontratoid => reg.contrato,
                                                    idtfechainspe => reg.fecha_inspeccion,
                                                    inutipoinspec => 3,
                                                    isbcertificado => reg.codigo_certi,
                                                    inuorganismoid => reg.unidad,
                                                    inuinspector => reg.cedula,
                                                    isbnombre_inspector => reg.inspector,
                                                    isbcodigosic => null,
                                                    idtfechavigencia => null,
                                                    inuresultado_inspeccion => 1,
                                                    isbred_individual => 'Y',
                                                    icuartefactos => null,
                                                    icudefnocritico => null,
                                                    isbaprobado => 'S',
                                                    isbmatricula => null,
                                                    isburl => null,
                                                    inuorderid => null,
                                                    cumensaje => sbMensaje);
      
      loop fetch sbMensaje into nuError, sbError, nuCertificado, nuContrato;
      EXIT WHEN sbMensaje%NOTFOUND;
        
        if nuError!=0 then 
           rollback;
           dbms_output.put_line('Error contrato :'||reg.contrato||':-'||nuError||'-'||sbError);
        else
          dbms_output.put_line('Contrato OK:'||reg.contrato||':-'||nuError||'-'||sbError);
          commit;
        end if;
      end loop;
      close sbMensaje;

    exception
      when others then
        dbms_output.put_line('Error contrato :'||reg.contrato||':-'||sqlerrm);
        rollback;
    end;
  end loop;
end; 
